import { BsPlusCircleFill } from "react-icons/bs";
import { FaRegLightbulb } from "react-icons/fa";

const Ideas = () => {
  return (
    <div className="flex justify-center flex-col md:mx-20 mx-0 h-screen ">
      <div className="w-full py-10 px-4 flex justify-between items-center border-b border-gray-300">
        <h5 className="text-xl font-semibold">My Ideas</h5>
        <BsPlusCircleFill size={40} color="green" />
      </div>
      <div className="">
        <div className="flex justify-center text-gray-300 flex-col space-y-3 w-full items-center h-full">
          <FaRegLightbulb size={52} />
          <p>Got Ideas?</p>
        </div>
      </div>
    </div>
  );
};

export default Ideas;
